// src/App.js
import React from 'react';
import Stock from './stocktock';
import './styles.css';

const App = () => {
    const stocks = ['IBM', 'AMZN', 'DOW', 'NASDAQ']; // Assuming these are the tickers available from your API

    return (
        <div className="app-container">
            <h1>Stock Dashboard</h1>
            {stocks.map(stock => <Stock key={stock} ticker={stock} />)}
        </div>
    );
}

export default App;
